import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from './Context/AuthContext';
import styles from '../styles/Plans.module.css';
import BrainIco from '../images/ico/BrainIco.png';

export default function Plans() {
  const { isAuthenticated, logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  return (
    <div className={styles.pageWrapper}>
      <header className={styles.header}>
        <div className={styles.logoArea}>
          <img src={BrainIco} alt="Ícone Brainboost" className={styles.headerIcon} />
          <h1 className={styles.logo}><a href="/">Brainboost</a></h1>
        </div>
        {isAuthenticated ? (
          <button onClick={handleLogout} className={styles.loginBtn}>Logout</button>
        ) : (
          <Link to="/login" className={styles.loginBtn}>Login</Link>
        )}
      </header>

      <main className={styles.mainContent}>
        <h2>Choose Your Meal Plan</h2>

        <div className={styles.planContainer}>
          <div className={styles.planCard}>
            <h3>Vegan Plan | Small</h3>
            <p className={styles.price}>$100</p>
            <p>7-day plan</p>
            <p>1 meal per day</p>
            <p>Arrives fresh every day</p>
            <button className={styles.planButton}>Select</button>
          </div>

          <div className={`${styles.planCard} ${styles.recommended}`}>
            <h3>Vegan Plan | Medium</h3>
            <p className={styles.price}>$188</p>
            <p>7-day plan</p>
            <p>2 meals per day</p>
            <p>1 snack per day</p>
            <p>Arrives fresh every day</p>
            <button className={styles.planButton}>Select</button>
          </div>

          <div className={styles.planCard}>
            <h3>Vegan Plan | Large</h3>
            <p className={styles.price}>$450</p>
            <p>Monthly plan</p>
            <p>3 meals per day</p>
            <p>1 snack per day</p>
            <p>Arrives fresh every day</p>
            <button className={styles.planButton}>Select</button>
          </div>
        </div>
      </main>
    </div>
  );
}
